 del Emmy) y su novia Valentina (Sofía Vergara, nominada al Emmy), por lo cual la familia se ve obligada a huir. La película introduce a nuevos personajes a los que ponen voz Joey King (Tren bala), el ganador de un Emmy Stephen Colbert (The Late Show with Stephen Colbert) y Chloe Fineman (Saturday Night Live). Pierre Coffin vuelve como la icónica voz de los Minions y el nominado al Oscar® Steve Coogan regresa como Silas Ramsbottom. Repleta de acción y con el humor subversivo característico de Illumination, Mi villano favorito 4 está dirigida por uno de los creadores de los Minions, el nominado al Oscar® Chris Renaud (Mi villano favorito, La vida secreta de las mascotas), y producida por el visionario fundador y CEO de Illumination, Chris Meledandri, y por Brett Hoffman (productor ejecutivo de Super Mario Bros. La película y Minions: Nace un villano). La película está codirigida por Patrick Delage (director de Sing 2: ¡Ven y canta de nuevo! y La vida secreta de las mascotas 2), y el guion es del ganador de un Emmy, Mike White, creador de White Lotus, y del veterano guionista de todas las películas de Mi villano favorito, Ken Daurio."}]},"longBylineText":{"runs":[{"text":"Animación • 2024"}]},"shortBylineText":{"runs":[{"text":"Animación • 2024"}]},"lengthText":{"accessibility":{"accessibilityData":{"label":"1 hora, 34 minutos y 23 segundos"}},"simpleText":"1:34:23"},"navigationEndpoint":{"clickTrackingParams":"CNgEEOzpCiITCKne0aDmiJIDFb-m_wQdmCwBPTIKZy1oaWdoLXB0c1oPRkV3aGF0X3RvX3dhdGNomgEGEI4eGOUBygEE4tlmrQ==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=djOJnQp-B6o\u0026pp=sAQB0gcJCU0KAYcqIYzvkggjdzJ3LWFjcS10dm9kLXBncC1zaGVsZi13ZWItdjItaWQtbXg%3D","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"djOJnQp-B6o","playerParams":"sAQB0gcJCU0KAYcqIYzvkggjdzJ3LWFjcS10dm9kLXBncC1zaGVsZi13ZWItdjItaWQtbXg%3D","watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr2---sn-0opoxu-bqal7.googlev ionSnippet":{"runs":[{"text":"De DreamWorks Animation llega una adaptación de una sensación literaria, el querido y premiado y best seller de Peter Brown, Robot Salvaje. La aventura épica sigue el viaje de un robot - ROZZUM unidad 7134, \"Roz\" para abreviar - que naufraga en una isla deshabitada y debe aprender a adaptarse al duro entorno, estableciendo gradualmente relaciones con los animales de la isla y convirtiéndose en la madre adoptiva de un ganso huérfano. Robot Salvaje está protagonizada por la ganadora del Premio de la Academia® Lupita Nyong’o (Nosotros, la franquicia The Black Panther) como el robot Roz; el nominado al Emmy y al Globo de Oro Pedro Pascal (The Last of Us, The Mandalorian) como el zorro Fink; la ganadora del Emmy Catherine O'Hara (Schitt's Creek, Very Inportant Perros) como la zarigüeya Pinktail; el nominado al Oscar® Bill Nighy (Vivir, Realmente Amor) como Goose Longneck; Kit Connor (Heartstopper, Rocketman) como el ganso Brightbill y la nominada al Oscar® Stephanie Hsu (Todo En Todas Partes Al Mismo Tiempo, Profesión Peligro) como Vontra, un robot que se cruzará con la vida de Roz en la isla. La película también cuenta con las voces del ícono de la cultura pop y ganador del Emmy, Mark Hamill (franquicia Star Wars, El Niño Y La Garza), Matt Berry (Casa Vampiro, franquicia Bob Esponja) y el ganador del Globo de Oro y nominado al Emmy. Ving Rhames (Misión: Imposible, Pulp Fiction). Una poderosa historia sobre el auto descubrimiento, un emocionante análisis del puente entre la tecnología y la naturaleza y una conmovedora exploración de lo que significa estar vivo y conectado con todos los seres vivos, Robot Salvaje está escrita y dirigida por el tres veces nominado al Oscar® Chris Sanders, escritor y director de Cómo entrenar a tu dragón de DreamWorks Animation, Los Croods y Lilo \u0026 Stitch de Disney, y está producido por Jeff Hermann (Un Jefe En Pañales 2: Negocios De Familia de DreamWorks Animation; coproductor de la franquicia Kung Fu Panda)."}]},"longBylineText":{"runs":[{"text":"Animación • 2025"}]},"shortBylineText":{"runs":[{"text":"Animación • 2025"}]},"lengthText":{"accessibility":{"accessibilityData":{"label":"1 hora, 41 minutos y 41 segundos"}},"simpleText":"1:41:41"},"navigationEndpoint":{"clickTrackingParams":"CM0EEOzpCiITCKne0aDmiJIDFb-m_wQdmCwBPTIKZy1oaWdoLXB0c1oPRkV3aGF0X3RvX3dhdGNomgEGEI4eGOUBygEE4tlmrQ==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=7C5riHRxrxg\u0026pp=sAQBkggjdzJ3LWFjcS10dm9kLXBncC1zaGVsZi13ZWItdjItaWQtbXg%3D","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"7C5riHRxrxg","playerParams":"sAQBkggjdzJ3LWFjcS10dm9kLXBncC1zaGVsZi13ZWItdjItaWQtbXg%3D","watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-0opoxu-bqal7.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=ec2e6b887471af18\u0026ip=2806%3A103e%3A33%3Aa13f%3A6c60%3Afb03%3Aace%3Aad3a\u0026initcwndbps=1863750\u0026mt=1768316006\u0026oweuc="}}}}},"badges":[{"metadataBadgeRenderer":{"style":"BADGE_STYLE_TYPE_YPC","label":"Comprar","trackingParams":"CM0EEOzpCiITCKne0aDmiJIDFb-m_wQdmCwBPQ=="}},{"metadataBadgeRenderer":{"style":"BADGE_STYLE_TYPE_SIMPLE","label":"A","trackingParams":"CM0EEOzpCiITCKne0aDmiJIDFb-m_wQdmCwBPQ=="}}],"trackingParams":"CM0EEOzpCiITCKne0aDmiJIDFb-m_wQdmCwBPQ==","serviceEndpoints":[{"clickTrackingParams":"CM0EEOzpCiITCKne0aDmiJIDFb-m_wQdmCwBPcoBBOLZZq0=","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/feedback"}},"feedbackEndpoint":{"feedbackToken":"AB9zfpIB-HrtahGqe5gnPdUxSg6wsllZesBEJ1uccS_rLdNo5xcNYYtp0TSgOo_kSd-IR4_bc96qSMG3XFcprLWdpWRkNtiuWkNVnUnBZkBklYq25fuvuOcWJvt0JEm7OSPaeLMarbabtIWm-uxp2W8ayn3KxoiCyUAb6JaydMGLvC6LIf_nygs","uiActions":{"hideEnclosingContainer":true}}}],"menu":{"menuRenderer":{"
